    false,nt"url": null,nt"notes": "North Dakota GIS Hub Open Geospatial Consortium
    (OGC) Web Feature Services (WFS) are used for streaming vector data to desktop and
    web-based applications.  These vector data include communications, emergency services,
    geology, government boundaries, government lands, hydrography, locations, and transportation.nnWFS
    is best used if the appearance of the data is to be changed by the user.  If this
    is not desired or required, then the pre-symbolized data from the GIS Hub should
    be used, i.e., use one of the services beginning with "All_".nnPlease see the
    Supplemental Information section for instructions on how to use these WFS services.",nt"license_title":
